import React from 'react';
import SimpleTableComp from '../../components/SimpleTableComp';

function CallsHistory() {

    const columns = [
        {
            accessor: 'date',
            header: 'תאריך',
            width: '130px',
        },
        {
            accessor: 'from',
            header: 'מאת',
            width: '130px',
        },
        {
            accessor: 'to',
            header: 'עבור',
            width: '130px',
        },
        {
            accessor: 'direction',
            header: '',
            width: '50px',
            renderCell: (row) => {
                return '<SettingsModal {...row}/>'
            }
        },

    ]

    return (
        <div style={{direction : "rtl"}}>
            CallsHistory
            <SimpleTableComp columns={columns}/>
        </div>
    );
}

export default CallsHistory;
